tables.table_schema:
CREATE TABLE interactions (interaction_id INT PRIMARY KEY, lead_id INT, interaction_date TIMESTAMP, interaction_type VARCHAR(50), outcome VARCHAR(50));

CREATE TABLE lead_preferences (lead_id INT PRIMARY KEY, preference_1 VARCHAR(50), preference_2 VARCHAR(50), preference_3 VARCHAR(50));

CREATE TABLE lead_demographics (lead_id INT PRIMARY KEY, first_name VARCHAR(50), last_name VARCHAR(50), email VARCHAR(50), phone_number VARCHAR(20));

CREATE TABLE engagement_strategies (strategy_id INT PRIMARY KEY, strategy_name VARCHAR(50), strategy_description TEXT, strategy_type VARCHAR(50));
